/*Table structure for table `dt_item_cabang` */

DROP TABLE IF EXISTS `dt_item_cabang`;

CREATE TABLE `dt_item_cabang` (
  `no` int(11) NOT NULL AUTO_INCREMENT,
  `id` varchar(100) NOT NULL,
  `cabang_id` int(11) unsigned DEFAULT NULL,
  `mi_id` int(11) unsigned NOT NULL,
  `stock_last` int(11) NOT NULL DEFAULT '0',
  `stock_min` int(11) NOT NULL DEFAULT '0',
  `stock_max` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `AK_IDENTIFIER_2` (`no`),
  KEY `FK_CB_ID` (`cabang_id`),
  KEY `FK_MI_ID` (`mi_id`),
  CONSTRAINT `FK_CB_ID` FOREIGN KEY (`cabang_id`) REFERENCES `dt_cabang` (`id`) ON DELETE SET NULL ON UPDATE NO ACTION,
  CONSTRAINT `FK_MI_ID` FOREIGN KEY (`mi_id`) REFERENCES `dt_item` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=38281 DEFAULT CHARSET=utf8;

